module.exports = {
  extends: 'airbnb-base',
  env: {
    jest: true,
  },
  plugins: ['jest'],
  globals: {
    BigInt: true,
  },

  // check package.json for files to include
  // files: ['src/**/*.js', 'book/interview-questions/*.js'],

  rules: {
    // https://github.com/airbnb/javascript/issues/1089

    // https://stackoverflow.com/a/35637900/684957
    // allow to add properties to arguments
    'no-param-reassign': [2, { props: false }],

    // https://eslint.org/docs/rules/no-plusplus
    // allows unary operators ++ and -- in the afterthought (final expression) of a for loop.
    'no-plusplus': [0, { allowForLoopAfterthoughts: true }],
    'no-continue': [0],

    // Allow for..of
    'no-restricted-syntax': [0, 'ForOfStatement'],

    // jest plugin
    // 'jest/no-disabled-tests': 'warn',
    'jest/no-focused-tests': 'error',
    'jest/no-identical-title': 'warn',
    'jest/valid-expect': 'warn',
  },
};

var Jasmine = require('jasmine');
var SpecReporter = require('jasmine-spec-reporter');

var jrunner = new Jasmine();
// jrunner.configureDefaultReporter({print: noop});    // jasmine < 2.4.1, remove default reporter logs
jrunner.env.clearReporters();                       // jasmine >= 2.5.2, remove default reporter logs
jrunner.addReporter(new SpecReporter());            // add jasmine-spec-reporter
jrunner.loadConfigFile('jasmine.json');                           // load jasmine.json configuration
jrunner.execute();

{
  "spec_dir": "src",
  "spec_files": [
    "**/*[sS]pec.js"
  ],
  "helpers": [
    "helpers/**/*.js"
  ],
  "stopSpecOnExpectationFailure": false,
  "random": false
}

module.exports = {
  name: 'dsa.js',
  // testPathIgnorePatterns: ['/node_modules/', '/dist/', '/lab/', '/benchmarks/', '/coverage/'],
};

module.exports = {
  name: 'dsa.js',
  testPathIgnorePatterns: ['/node_modules/', '/dist/', '/lab/', '/benchmarks/', '/coverage/'],
};

